import styled from 'styled-components';

export const Container = styled.div`
  width: 150px;
  height: 200px;
  background-color: blue;
  display: flex;
  flex-direction: column;
  justify-content: center;
  margin: 20px;
  align-items: space-around;

  img {
      width: 90%;
  }
`;
